// Obtener los datos del JSON desde el webhook
const datosOriginales = $('Webhook').item.json.body.call.transcript_with_tool_calls[27].arguments;

// Parsear el JSON si viene como string
const datos = typeof datosOriginales === 'string' ? JSON.parse(datosOriginales) : datosOriginales;

// Extraer cada campo a una variable
const tipoPropiedad = datos.tipo_propiedad || '';
const horaPropuesta = datos.hora_propuesta || '';
const direccionCita = datos.direccion_cita || '';
const ubicacionAnuncio = datos.ubicacion_anuncio || '';
const tipoAnuncio = datos.tipo_anuncio || '';
const esPropietario = datos.es_propietario || false;
const nombrePropietario = datos.nombre_propietario || '';
const confirmacionCita = datos.confirmacion_cita || false;
const telefonoContacto = datos.telefono_contacto || '';

// Retornar todas las variables en el objeto de salida
return {
  tipo_propiedad: tipoPropiedad,
  hora_propuesta: horaPropuesta,
  direccion_cita: direccionCita,
  ubicacion_anuncio: ubicacionAnuncio,
  tipo_anuncio: tipoAnuncio,
  es_propietario: esPropietario,
  nombre_propietario: nombrePropietario,
  confirmacion_cita: confirmacionCita,
  telefono_contacto: telefonoContacto,

  // TambiÃ©n incluir el objeto completo por si lo necesitas
  datos_completos: datos
};
